A empresa vencedora deverá apresentar os seguintes documentos: 
Proposta contendo as seguintes informações: 
Fator embalagem dos materiais contratados, especificando a quantidade de unidades por embalagem;
Marca, fabricante e rótulo, quando aplicável;
Prazo de validade;
Bula (quando medicamento) ou folder explicativo (quando produto para saúde) ou manual do equipamento explicativo em português e/ou inglês; 
Autorização de Funcionamento de Empresa - AFE, expedida pela Agência Nacional de Vigilância Sanitária – ANVISA; 
Alvará Sanitário ou Licença de Funcionamento ou Licença Sanitária Estadual, Municipal ou do Distrito Federal, dentro do prazo de validade, emitida pela Vigilância Sanitária da Secretaria de Saúde Estadual, Municipal ou do Distrito Federal, da sede da empresa interessada; 
Registro do Produto na Anvisa através da publicação Diário Oficial da União com a informação referente à validade (dia/mês/ano) ou a Notificação também emitida pela Agência Nacional de Vigilância Sanitária – ANVISA ou a apresentação de consulta ao sítio da ANVISA; 
Declaração de que não emprega menor de idade; 
Declaração de que não possui fatos impeditivos para contratar com a administração pública e 
Declarações indiretas constantes no artigo 69 do RLCE 2.0 da Ebserh, relação que segue anexada juntamente com o Termo de Referência.
Solicitamos observar os itens, que apesar de terem o mesmo CATMAT, são itens diferentes quanto às medidas solicitadas.
